import React from 'react';
import { Switch ,Route} from 'react-router-dom';

const Topic = props => {
  console.log(props)
  return(
     <div>
      <h1>Topic Home Page</h1>
    </div>
  )
};

const TopicListPage = (props) =>{
  console.log(props)
  return(
  <div>
    <h1>Topic List Page .....</h1>
  </div>
  )
}
const TopicPageDetail = props => {
  console.log(props)
  return (
  <div>
    <h1>Topic Page Detail.....</h1>
  </div>
  )
}


function App() {
  return (
  <div>
    <Switch>
        <Route exact path="/" component={Topic} />
        <Route exact path='/list' component={TopicListPage} />
        <Route path='/detail' component={TopicPageDetail} />
    </Switch>

  </div>
  );
  }


